SELECT DECODE(O.ie_grau_satisfacao, 'R', 'Regular', 'P', 'Péssimo', 'B', 'Bom', 'N','Não se Aplica','O','Ótimo','E','Exelente','','Enc Automático') ie_grau_satisfacao, O.TOTAL_SATISFACAO, round( ((O.TOTAL_SATISFACAO*100) / ( select COUNT (x.nr_sequencia) T_ENCERRADAS froM man_ordem_servico x where 1=1 and x.ie_status_ordem = '3' and x.nr_seq_estagio in (select nr_sequencia from man_estagio_processo where ie_acao = 1) and x.nr_grupo_trabalho = :NR_GRUPO_TRABALHO and x.nr_seq_wheb is null and x.nr_seq_estagio in (select nr_sequencia from man_estagio_processo where ie_acao = 1) and x.nr_seq_meta_pe is null and (x.dt_fim_real between :DT_INICIAL and fim_dia(:DT_FINAL)) ) ),2) PORCENTAGEM FROM( select count(x.nr_sequencia) TOTAL_SATISFACAO, x.ie_grau_satisfacao from man_ordem_servico x where 1=1 and x.ie_status_ordem = '3' and x.nr_grupo_trabalho = :NR_GRUPO_TRABALHO and x.nr_seq_wheb is null and (x.dt_fim_real between :DT_INICIAL and fim_dia(:DT_FINAL)) group by x.ie_grau_satisfacao
) O order by O.Ie_Grau_Satisfacao asc >
> OS Encerradas/Satisfação >

Select T.Total, T.Ds_Pessoa FROM ( SELECT count (o.nr_sequencia) Total, obter_nome_pf(O.Cd_Pessoa_Solicitante) DS_PESSOA FROM( select x.nr_sequencia, x.ie_grau_satisfacao, x.CD_PESSOA_SOLICITANTE, l.DS_LOCALIZACAO from man_localizacao l, man_ordem_servico x where 1=1 and x.nr_seq_localizacao = l.nr_sequencia and x.ie_status_ordem = '3' and x.nr_grupo_trabalho = :NR_GRUPO_TRABALHO and x.nr_seq_wheb is null and (x.dt_ordem_servico between :DT_INICIAL and fim_dia(:DT_FINAL))
) O where DECODE(O.ie_grau_satisfacao, '','Sem Informação') = 'Sem Informação' group by obter_nome_pf(O.Cd_Pessoa_Solicitante) order by Total desc )T WHERE T.Total >= 2 >
> OS Sem Classificação Usuários >


